import React from 'react'
import "./List.scss"
import ArrowBackIosNewOutlinedIcon from '@mui/icons-material/ArrowBackIosNewOutlined';


const List = () => {
  return (
    <div className='List'>
      <span className="listTitle">
        Continue to watch 
      </span>
      <div className="wrapper">
        <ArrowBackIosNewOutlinedIcon/>
      </div>
    </div>
  )
}

export default List
